import { Link, NavLink } from "react-router-dom";
import classes from "./Layout.module.scss";

const Header = () => {
  return (
    <header>
      <h1>Movie App</h1>
      <ul>
        <li>
          <NavLink
            className={({ isActive }) =>
              isActive ? classes.active : undefined
            }
            to="/"
            end
          >
            Home
          </NavLink>
        </li>
        <li>
          <NavLink to="suggest-movie">suggest movie</NavLink>
        </li>
      </ul>
    </header>
  );
};

export default Header;
